public class Solution {
    public bool CanSplitArray(IList<int> nums, int m) {
        int n = nums.Count;
        int[] prefixSum = new int[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + nums[i];
        }

        bool[,] memo = new bool[n, n];
        bool[,] calculated = new bool[n, n];

        return CanSplit(0, n - 1, m, nums, prefixSum, memo, calculated);
    }

    private bool CanSplit(int start, int end, int m, IList<int> nums, int[] prefixSum, bool[,] memo, bool[,] calculated) {
        if (start == end) return true; // Single element
        if (calculated[start, end]) return memo[start, end];

        int sum = prefixSum[end + 1] - prefixSum[start];
        if (sum < m) { // If sum of the segment is less than m, it's impossible to split accordingly
            calculated[start, end] = true;
            memo[start, end] = false;
            return false;
        }

        for (int i = start; i < end; i++) {
            int leftSum = prefixSum[i + 1] - prefixSum[start];
            int rightSum = prefixSum[end + 1] - prefixSum[i + 1];
            if ((leftSum >= m || i == start) && (rightSum >= m || i == end - 1)) {
                if (CanSplit(start, i, m, nums, prefixSum, memo, calculated) && CanSplit(i + 1, end, m, nums, prefixSum, memo, calculated)) {
                    calculated[start, end] = true;
                    memo[start, end] = true;
                    return true;
                }
            }
        }

        calculated[start, end] = true;
        memo[start, end] = false;
        return false;
    }
}
